import HeroCard from '../HeroCard'

export default function HeroList ({ heroes }) {
    return (
        <div>
           {
               heroes.map(({ name, thumbnail }, key) => {
                   <HeroCard key={`hero-card-${key}`} name={name} thumbnail={thumbnail} />
               })
           }
        </div>
    )
}
